import { createSlice } from "@reduxjs/toolkit";

const initialState = {
  isLoading: false,
  message: {
    msg: [],
    color: "",
    status: false,
    isRegistered: false,
  },
};

const registerSlice = createSlice({
  name: "register",
  initialState,
  reducers: {},
});
export default registerSlice;

